            CPF : '032.381.932-00', 
            N_processo: '97098.098760-0987', 
            ex_adverso: 'NET'
        };
      }

    render(){
        return(
            <ul className="add_padding">
                    <p class="split-para2">Nome: {this.state.nome} <span >CPF: {this.state.CPF}</span></p>
                    <p class="split-para2">NÂº do processo: {this.state.N_processo} <span>Ex Adverso: {this.state.ex_adverso}</span></p>
            </ul>
        )
    }
}

class Button extends React.Component{
